import React, { Component } from 'react';

import '../css/Game.css';

export default class Game extends Component {
  render() {
    return (
      <div>
        <h1>Table de Jeux</h1>
        <table>
          <tr>
            <th>Ma carte</th>
          </tr>
          <tr></tr>
        </table>
      </div>
    )
  }
}
